    public static function getPinYin($str)
    {
        $pinYinStr = '';
        if(!TString::isUtf8($str))
        {
            $str =  mb_convert_encoding($str, 'UTF-8', 'GBK');
        }
        $encode = 'UTF-8';
        $length = mb_strlen($str, $encode);
        for($i = 0; $i < $length; $i++)
        {
            $tmp =  mb_substr($str, $i, 1, $encode);
            $pinYinStr .= isset(PinYin::$PinYin[$tmp]) ? PinYin::$PinYin[$tmp] : '';
        }
        return $pinYinStr;
    }
}
